import './index.scss'
import LogoZ from '../../../assets/images/solid-z.png'
import { useEffect, useRef } from 'react'
import { DrawSVGPlugin } from 'gsap-trial/DrawSVGPlugin'
import gsap from 'gsap-trial'

const Logo = () => {
    const bgRef = useRef()
    const outlineLogoRef = useRef()
    const solidLogoRef = useRef()

    useEffect(() => {
        gsap.registerPlugin(DrawSVGPlugin)

        gsap.timeline().to(bgRef.current, {
            duration: 1,
            opacity: 1,
        })
        .from(outlineLogoRef.current, {
            drawSVG: 0,
            duration: 20,
        })
    }, [])

    return (
        <div className="logo-container" ref={bgRef}>
            <img ref={solidLogoRef} className="solid-logo" src={LogoZ} alt="z" />

            <svg version="1.2" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1400 1400" width="1000" height="1000">
                <title>New Project</title>
                <defs>
                    <image  width="612" height="847" id="img1" href="data:image/png;base64,"/>
                </defs>
                <style>
                </style>
                <use ref={outlineLogoRef} id="z" href="#img1" x="600" y="300"/>
            </svg>
        </div>
    )
}
export default Logo
